import{o as e,c as s,a}from"./app.88357bea.js";const r='{"title":"Ressource : Supression d\'une sous-catégorie","description":"","frontmatter":{},"headers":[{"level":2,"title":"1. Description de la Resource","slug":"_1-description-de-la-resource"},{"level":2,"title":"2. URL et Méthode d\'accès","slug":"_2-url-et-methode-d-acces"},{"level":2,"title":"3. Paramètres","slug":"_3-parametres"},{"level":2,"title":"4. Requête réussie","slug":"_4-requete-reussie"},{"level":2,"title":"5. Cas d\'échec d\'une requête","slug":"_5-cas-d-echec-d-une-requete"}],"relativePath":"guide/services/transactions/subcategory/delete.md","lastUpdated":1626345652157}',t={},o=a('<h1 id="ressource-supression-d-une-sous-categorie"><a class="header-anchor" href="#ressource-supression-d-une-sous-categorie" aria-hidden="true">#</a> Ressource : Supression d&#39;une sous-catégorie</h1><hr><h2 id="_1-description-de-la-resource"><a class="header-anchor" href="#_1-description-de-la-resource" aria-hidden="true">#</a> 1. Description de la Resource</h2><p>Cette ressource permet de supprimer une sous-catégorie.</p><h2 id="_2-url-et-methode-d-acces"><a class="header-anchor" href="#_2-url-et-methode-d-acces" aria-hidden="true">#</a> 2. URL et Méthode d&#39;accès</h2><p>Pour supprimer une sous-catégorie, vous faites appel à l&#39;url suivante:</p><div class="language-"><pre><code>url: /sous-category/id\nid = l&#39;identifiant de la sous catégorie.\n</code></pre></div><div class="danger custom-block"><p class="custom-block-title">Rappel</p><p>L&#39;accès aux données à cette ressource se fait via la méthode <strong><code>POST</code></strong></p></div><h2 id="_3-parametres"><a class="header-anchor" href="#_3-parametres" aria-hidden="true">#</a> 3. Paramètres</h2><p>Les paramètres de cette ressouce sont les mêmes que celle de l&#39;enregistrement des catégories qui sont définis sur la section suivante : <a href="/guide/services/transactions/subcategory/store.html#_3-parametres">Paramètres</a></p><h2 id="_4-requete-reussie"><a class="header-anchor" href="#_4-requete-reussie" aria-hidden="true">#</a> 4. Requête réussie</h2><p>Lorsque la requête est validée avec succès, il s&#39;affichera un resultat de type suivant:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;message&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Votre opération a été traité avec succès.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="_5-cas-d-echec-d-une-requete"><a class="header-anchor" href="#_5-cas-d-echec-d-une-requete" aria-hidden="true">#</a> 5. Cas d&#39;échec d&#39;une requête</h2><p>En cas d&#39;échec, Si par exemple la sous catégorie n&#39;existe pas, vous aurez un message de type:</p><div class="language-json"><pre><code><span class="token punctuation">{</span>\n  <span class="token property">&quot;message&quot;</span><span class="token operator">:</span> <span class="token string">&quot;Ce(tte) sous catégorie(type) n&#39;exist(e) pas.&quot;</span>\n<span class="token punctuation">}</span>\n</code></pre></div>',16);t.render=function(a,r,t,c,n,u){return e(),s("div",null,[o])};export default t;export{r as __pageData};
